export const mapEditOfficeOfQualificationFormToApiRequest = (
  values,
  imgBase64,
) => {
  let mapDataToRequest =
    !!values.members &&
    values.members.map((item, i) => ({
      year: item.year,
      announcement: item.announcement,
      persons: item.persons.map((item2) => ({
        name: item2.name,
        position: item2.position,
        documentFiles: !!item2.fileImg ? imgBase64 : item2.documentFiles,
      })),
    }));

  return { qualified: mapDataToRequest };
};
